@wssman the text file has comment 36 blank as shown below:

@11לה) ר"ל רצפת העליונה: 
@11לו) 
@11לז) וסיפי' דקרא "כי מגרעות נתן לבית סביב חוצה" ר"ל חומת ההיכל היתה עביה מתמעטת והולכת מבחוץ, אמה אחת נגד כל תקרה ותקרה של התאים. "לבלתי אחוז בקירות הבית" ר"ל כדי שלא יצטרך לעשות נקבים בכותל ההיכל לתחוב שם קורות של תקרת התאים. אבל השתא שכותל ההיכל מתמעט והולך נגד כל תקרה ותקרה כעין מדריגות, היה משכיב ומניח ראשי קורות התקרות של התאים על אותו מדריגה שנתמעט החומה על ידי זה, ועי' בציור בבועז ותבין:

@wssman @jonathanmosenkis @stevenkaplan6 @zevlanderer 
Yachin on Oholot
I have found missing text in the text file of the Yachin on Oholot, when checking the original pdf text I found that the Yachin text is in two columns on this page although it is usually only on one and therefore a large portion of the Yachin is missing. I wrote "Missing Text" in the text file attached here indicating where the missing text should go.

@ari_eb Chapter 6 has an introductory line before the first paragraph: (שנו החכמים בלשון המשנה ברוך שבחר בהם ובמשנתם) It is there in the Vilna so I put it back in, in parenthesis: http://draft.sefaria.org/Pirkei_Avot.6/he/Vilna_Mishna?lang=he&layout=lines&sidebarLang=all
I had to realign English and TE. TE is missing the first few lines of Mishna 11: http://draft.sefaria.org/Pirkei_Avot.6/he/Torat_Emet_357?lang=he&layout=lines&sidebarLang=all
Despite changes references from text seem to align properly
